// src/store/authSlice.js
import { createSlice, createAsyncThunk } from '@reduxjs/toolkit';
import authService from '../services/authService';

// Async thunks for authentication
export const loginUser = createAsyncThunk(
  'auth/login',
  async ({ username, password }, { rejectWithValue }) => {
    try {
      console.log('ðŸ” Auth slice: Starting login...');

      const response = await authService.login(username, password);

      console.log('ðŸ” Auth slice: Login response:', {
        status: response.status,
        hasToken: !!response.data?.access_token,
        hasUser: !!response.data?.user
      });

      return response.data;
    } catch (error) {
      console.error('ðŸ” Auth slice: Login error:', error);
      return rejectWithValue(error.response?.data?.detail || error.message || 'Login failed');
    }
  }
);

export const registerUser = createAsyncThunk(
  'auth/register',
  async ({ username, password, email }, { rejectWithValue }) => {
    try {
      console.log('ðŸ‘¤ Auth slice: Starting registration...');

      const response = await authService.register(username, password, email);

      console.log('ðŸ‘¤ Auth slice: Registration response:', {
        status: response.status,
        hasToken: !!response.data?.access_token,
        hasUser: !!response.data?.user
      });

      return response.data;
    } catch (error) {
      console.error('ðŸ‘¤ Auth slice: Registration error:', error);
      return rejectWithValue(error.response?.data?.detail || error.message || 'Registration failed');
    }
  }
);

export const logoutUser = createAsyncThunk(
  'auth/logout',
  async (_, { dispatch }) => {
    try {
      await authService.logout();
      console.log('ðŸšª Auth slice: Logout completed');
      return null;
    } catch (error) {
      console.error('ðŸšª Auth slice: Logout error:', error);
      // Continue with logout even if API call fails
      return null;
    }
  }
);

export const getCurrentUser = createAsyncThunk(
  'auth/getCurrentUser',
  async (_, { rejectWithValue }) => {
    try {
      const response = await authService.getCurrentUser();
      return response.data;
    } catch (error) {
      console.error('ðŸ‘¤ Auth slice: Get current user error:', error);
      return rejectWithValue(error.response?.data?.detail || error.message);
    }
  }
);

export const updateUserProfile = createAsyncThunk(
  'auth/updateProfile',
  async (userData, { rejectWithValue }) => {
    try {
      const response = await authService.updateProfile(userData);
      return response.data;
    } catch (error) {
      console.error('ðŸ‘¤ Auth slice: Update profile error:', error);
      return rejectWithValue(error.response?.data?.detail || error.message);
    }
  }
);

// Initial state with token from localStorage
const getInitialState = () => {
  const token = localStorage.getItem('token');
  const userStr = localStorage.getItem('user');
  let user = null;

  if (userStr) {
    try {
      user = JSON.parse(userStr);
    } catch (error) {
      console.error('Failed to parse stored user data:', error);
      localStorage.removeItem('user');
    }
  }

  console.log('ðŸ Auth slice initial state:', {
    hasToken: !!token,
    hasUser: !!user,
    isAuthenticated: !!(token && user && authService.isTokenValid())
  });

  return {
    user: user,
    token: token,
    isAuthenticated: !!(token && user && authService.isTokenValid()),
    loading: false,
    error: null,
  };
};

const authSlice = createSlice({
  name: 'auth',
  initialState: getInitialState(),
  reducers: {
    setUser: (state, action) => {
      console.log('ðŸ“ Auth slice: Setting user:', action.payload);
      state.user = action.payload;
      state.isAuthenticated = !!(state.token && action.payload);

      if (action.payload) {
        localStorage.setItem('user', JSON.stringify(action.payload));
      }
    },

    setToken: (state, action) => {
      console.log('ðŸ”‘ Auth slice: Setting token');
      state.token = action.payload;
      state.isAuthenticated = !!(action.payload && state.user);

      if (action.payload) {
        localStorage.setItem('token', action.payload);
      } else {
        localStorage.removeItem('token');
      }
    },

    clearError: (state) => {
      state.error = null;
    },

    resetAuth: (state) => {
      console.log('ðŸ”„ Auth slice: Resetting auth state');
      state.user = null;
      state.token = null;
      state.isAuthenticated = false;
      state.loading = false;
      state.error = null;

      localStorage.removeItem('token');
      localStorage.removeItem('user');
    },
  },

  extraReducers: (builder) => {
    builder
      // Login cases
      .addCase(loginUser.pending, (state) => {
        state.loading = true;
        state.error = null;
      })
      .addCase(loginUser.fulfilled, (state, action) => {
        console.log('âœ… Auth slice: Login fulfilled');

        state.loading = false;
        state.error = null;

        if (action.payload?.access_token && action.payload?.user) {
          state.token = action.payload.access_token;
          state.user = action.payload.user;
          state.isAuthenticated = true;

          localStorage.setItem('token', action.payload.access_token);
          localStorage.setItem('user', JSON.stringify(action.payload.user));
        }
      })
      .addCase(loginUser.rejected, (state, action) => {
        console.error('âŒ Auth slice: Login rejected');
        state.loading = false;
        state.error = action.payload || 'Login failed';
        state.isAuthenticated = false;
      })

      // Registration cases
      .addCase(registerUser.pending, (state) => {
        state.loading = true;
        state.error = null;
      })
      .addCase(registerUser.fulfilled, (state, action) => {
        console.log('âœ… Auth slice: Registration fulfilled');

        state.loading = false;
        state.error = null;

        if (action.payload?.access_token && action.payload?.user) {
          state.token = action.payload.access_token;
          state.user = action.payload.user;
          state.isAuthenticated = true;

          localStorage.setItem('token', action.payload.access_token);
          localStorage.setItem('user', JSON.stringify(action.payload.user));
        }
      })
      .addCase(registerUser.rejected, (state, action) => {
        console.error('âŒ Auth slice: Registration rejected');
        state.loading = false;
        state.error = action.payload || 'Registration failed';
        state.isAuthenticated = false;
      })

      // Logout cases
      .addCase(logoutUser.fulfilled, (state) => {
        console.log('âœ… Auth slice: Logout fulfilled');
        state.user = null;
        state.token = null;
        state.isAuthenticated = false;
        state.error = null;

        localStorage.removeItem('token');
        localStorage.removeItem('user');
      })

      // Get current user cases
      .addCase(getCurrentUser.pending, (state) => {
        state.loading = true;
      })
      .addCase(getCurrentUser.fulfilled, (state, action) => {
        state.loading = false;
        state.user = action.payload.user;
        state.isAuthenticated = true;

        localStorage.setItem('user', JSON.stringify(action.payload.user));
      })
      .addCase(getCurrentUser.rejected, (state, action) => {
        state.loading = false;
        state.error = action.payload;
        // Don't log out automatically on getCurrentUser failure
      })

      // Update profile cases
      .addCase(updateUserProfile.pending, (state) => {
        state.loading = true;
        state.error = null;
      })
      .addCase(updateUserProfile.fulfilled, (state, action) => {
        state.loading = false;
        state.user = action.payload.user;

        localStorage.setItem('user', JSON.stringify(action.payload.user));
      })
      .addCase(updateUserProfile.rejected, (state, action) => {
        state.loading = false;
        state.error = action.payload;
      });
  },
});

export const { setUser, setToken, clearError, resetAuth } = authSlice.actions;

export default authSlice.reducer;
